import './App.css';
import {useState,useEffect} from 'react';


const App = () =>  {
  const[cnt,setCnt] = useState(212);
  return (
    <div className="App">
      <>
      <button onClick={() => {
        setCnt((cnt)=>cnt*3);
      }}>*3</button>
      <h2>{cnt}</h2>
      <button onClick={()=>{
        setCnt((cnt)=>cnt/3);
      }}>/3</button>
      </>
    </div>
  );
}

export default App;
